create table nts_project
(
    id              bigint auto_increment
        primary key,
    project_name    varchar(64)                                                                                                                          null comment '项目名称',
    project_address varchar(255)                                                                                                                         null comment '项目地址',
    project_type    varchar(32)                                                                                                                          null comment '项目类型',
    remark          varchar(255)                                                                                                                         null comment '备注',
    image           varchar(255) default 'https://storage-public.zhaopin.cn/user/avatar/1585552650695555420/upload_83ecfa146c026b0a11861855ff6ee164.png' null comment '图片url',
    create_time     timestamp                                                                                                                            null,
    create_by       varchar(64)                                                                                                                          null,
    update_time     timestamp                                                                                                                            null,
    update_by       varchar(64)                                                                                                                          null,
    delete_flag     tinyint(1)   default 0                                                                                                               null comment '删除标记0：正常 1：删除'
);

